import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Link } from "react";

export default class Logo extends React.Component {
  render() {
    return (
      <Link
        to="../pages/Home.jsx"
        className="container p-4"
        style={{
          fontSize: "30px",
          display: "flex-row",
          fontWeight: "900",
          color: "white",
          cursor: "pointer",
          textDecoration: "none",
          href: "../pages/Home.jsx"
        }}
      >
        &lt; JB <span style={{ color: "yellow" }}>/ </span>&gt;
      </Link>
    );
  }
}
